import './App.css';
import Reiniciar from './Components/Reiniciar';
import NumeroSecreto from '.Components/NumeroSecreto';
import Formulario from './Components/Formulario';

function App() {
  return (
    <div className="container">
    <Reiniciar/>
    <h1>¡Adivina mi número!</h1>
    <NumeroSecreto/>
    <br/>

    <Formulario/>

    <div className="score-section">
      <br/>
      <p>Empiece a adivinar...</p>  
      <br/>
      <p>Puntuación: <span id="score">20</span></p>
      <p>Puntaje Alto: <span id="highscore">0</span></p>
    </div>
  </div>
  );
}

export default App;
